import styled from 'styled-components';
import { Drawer } from 'antd';
import { respondTo } from '../../Utils/mixins';

export const WrapperDrawer = styled(Drawer)`
  display: none;

  ${respondTo.mobile`
 display:flex;

  `}
`;
export const WrapperNavBar = styled.div`
  display: flex;
  justify-content: space-between;
  ${respondTo.mobile`
 display:none;


  `};
`;
